import styled from 'styled-components';

const ULLinks = styled.ul
    `
        list-style-type: none;
        display: flex;
        justify-content: center;
        margin: auto;
        flex: 1;
        @media (min-width: 292px) {
            display: none;
        }
        @media (min-width: 1100px) {
            display: flex;
        }
    `;

const Link = styled.li
`
    cursor: pointer;
    text-align: center;
    padding: 5px 10px;
    margin: 0 5px;
    border-radius: 10px;
    transition: all 0.2s ease-in-out;

     &:hover{
        background: #D66CC5;
     }
     &:focus{
        background: #B26CD6;
     }
`;

const Links = () => {
    return(
        <ULLinks>
            <Link>Sign Up</Link>
            <Link>Log In</Link>
            <Link>Log Out</Link>
        </ULLinks>
    )
}

export default Links;
